-- Procedure structure for listarEmpresa
-- ----------------------------
DROP PROCEDURE IF EXISTS `listarEmpresa`;
delimiter ;;
CREATE PROCEDURE `listarEmpresa`()
BEGIN
SELECT e.id ,e.direccion,e.estado,e.estado_comercial,e.fecha_registro, e.ruc ,e.id_grupo,e.id_rubro,e.id_tipo_integracion,e.id_tipo_sistema,e.id_ubigeo,e.nom_comercial,e.razon_social,e.tipo_envio,e.tipo_persona, b.logo FROM `empresa` as e LEFT JOIN  `bandera` as b ON b.id_empresa = e.ruc WHERE(e.eliminada = 1);
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
